import React from "react";
import ToggleTheme from "../ToggleTheme";

const Header = () => {
  return (
    <header className="bg-white dark:bg-gray-700 shadow-sm lg:stickyntop-0 z-20">
      <nav
        className={`lg:hidden absolute w-full bg-white dark:bg-gray-700 z-30`}
        aria-label="Global"
      >
        <div className="p-3">
          <div className="flex-shrink-0 relative flex justify-center w-full">
            <ToggleTheme />
          </div>
        </div>
      </nav>
    </header>
  );
};

export default Header;
